import React, {Fragment} from 'react';
import Header from './Header';
import Sidebar from './Sidebar';
import CrearUsuarios from './usuarios/crearUsuarios';
import AdministrarUsuarios from './usuarios/administrarUsuarios';
const Content = () => {
    return ( 
        <Fragment>
            <Header />
            <div className="row">
                <div className="col-md-2 bg-danger">
                <Sidebar />
                </div>                
               <div className="col-md-6 bg-success ml-4 p-4">
                   <div className="container">
                       <div className="row">
                            <CrearUsuarios />
                       </div>
                            

                   </div>
                    <h2>Contenido aqui</h2>
               </div>
            </div>                        
        </Fragment>
     );
}
 
export default Content;
